create table answer_info
(
    questionnaire_id varchar(50) not null comment '所属问卷ID',
    type             int         not null comment '问题类型',
    question_id      varchar(50) not null comment '所属问题ID',
    option_id        varchar(50) null comment '选项ID',
    fill_content     text        null comment '填空内容',
    respondent       char(32)    not null comment '问卷答卷人',
    answer_time      datetime    not null comment '答卷时间',
    left_title       text        null comment '单项左标题',
    constraint answer_info_option_info_id_fk
        foreign key (option_id) references option_info (id),
    constraint answer_info_question_info_id_fk
        foreign key (question_id) references question_info (id)
)
    comment '问卷回答信息';

